const Colors = {
  "icon-lizard.svg": {
    gradient: "radial-gradient(circle, white 53%, hsl(261, 72%, 63%) 10%)",
    border: "hsl(261, 73%, 60%)"
  },
  "icon-paper.svg": {
    gradient: "radial-gradient(circle, white 53%, hsl(230, 89%, 62%), hsl(230, 89%, 65%) 10%)",
    border: "hsl(230, 89%, 65%)"
  },
  "icon-rock.svg": {
    gradient: "radial-gradient(circle, white 53%, hsl(349, 71%, 52%), hsl(349, 70%, 56%) 10%)",
    border: "hsl(349, 70%, 56%)"
  },
  "icon-scissors.svg": {
    gradient: "radial-gradient(circle, white 53%, hsl(39, 89%, 49%), hsl(40, 84%, 53%) 10%)",
    border: "hsl(40, 84%, 53%)"
  },
  "icon-spock.svg": {
    gradient: "radial-gradient(circle, white 53%, hsl(189, 59%, 53%), hsl(189, 58%, 57%) 10%)",
    border: "hsl(189, 58%, 57%)"
  }
};

export default Colors;
